import { Formik } from 'formik'
import React from 'react'
import { useState } from 'react'
import Swal from 'sweetalert2'


const CompetitionEntry = () => {


    const [currentUser, setCurrentUser] = useState(JSON.parse(sessionStorage.getItem('user')))
    console.log(currentUser)

    const competitionData = async (formdata, { resetForm }) => {

        console.log(formdata)
        // resetForm()

        // const res = await fetch('http://localhost:5000/competition/add', {
        //     method: 'POST',
        //     body: JSON.stringify(formdata),
        //     headers: {
        //         'Content-Type': 'application/json'
        //     }
        // })

        // console.log(res.status);

        // if (res.status === 200) {
        //     Swal.fire({
        //         icon: 'success',
        //         title: 'Success',
        //         text: 'Data Added Successfully'
        //     })
        //     resetForm()
        // }

    }






    return (
        <div className='container mt-3'>

            <h2 className='text-center'>ENTER DETAILS OF COMPETITION</h2>

            <Formik
                initialValues={{
                    mode: "",
                    date: "",
                    description: "",
                    rules: "",
                    rewards: "",
                    venue: "",
                    requirement: "",
                    // user: currentUser._id
                }}
                onSubmit={competitionData}
            >
                {({ values, handleChange, handleSubmit }) => (<form onSubmit={handleSubmit}>
                    <div className="row mt-3">

                        <div className="col-md-6">

                            <div className="form-check mt-2">
                                <input
                                    className="form-check-input"
                                    type="radio"
                                    name="mode"
                                    id="offline"
                                    onChange={handleChange}
                                    value={values.mode}
                                />
                                <label className="form-check-label" htmlFor="offline">
                                    Offline
                                </label>
                            </div>

                            <div className="form-check">
                                <input
                                    className="form-check-input"
                                    type="radio"
                                    name="mode"
                                    id="online"
                                    onChange={handleChange}
                                    value= "online"
                                />
                                <label className="form-check-label" htmlFor="online">
                                    Online
                                </label>
                            </div>

                            <div className="my-3">
                                <label className="form-label" htmlFor="form12">
                                    <b>Date and Time</b>
                                </label>
                                <input type="datetime-local" id="form12" className="form-control" name='date' onChange={handleChange}
                                    value={values.date} />
                            </div>

                            <div className="mb-3">
                                <label className="form-label" htmlFor="textAreaExample">
                                    <b>Rules</b>
                                </label>
                                <textarea
                                    className="form-control"
                                    id="textAreaExample"
                                    rows={4}
                                    name='rules'
                                    onChange={handleChange}
                                    value={values.rules}
                                />
                            </div>

                            <div className="mb-3">
                                <label className="form-label" htmlFor="textAreaExample">
                                    <b>Venue</b>
                                </label>
                                <textarea
                                    className="form-control"
                                    id="textAreaExample"
                                    rows={4}
                                    name='venue'
                                    onChange={handleChange}
                                    value={values.venue}
                                />
                            </div>
                        </div>

                        <div className="col-md-6">

                            <div className="mb-3">
                                <label className="form-label" htmlFor="textAreaExample">
                                    <b>Description</b>
                                </label>
                                <textarea
                                    className="form-control"
                                    id="textAreaExample"
                                    rows={4}
                                    name='description'
                                    onChange={handleChange}
                                    value={values.description}
                                />
                            </div>

                            <div className="mb-3">
                                <label className="form-label" htmlFor="textAreaExample">
                                    <b>Rewards</b>
                                </label>
                                <textarea
                                    className="form-control"
                                    id="textAreaExample"
                                    rows={4}
                                    name='rewards'
                                    onChange={handleChange}
                                    value={values.rewards}
                                />
                            </div>

                            <div className="mb-3">
                                <label className="form-label" htmlFor="textAreaExample">
                                    <b>Requirement</b>
                                </label>
                                <textarea
                                    className="form-control"
                                    id="textAreaExample"
                                    rows={4}
                                    name='requirement'
                                    onChange={handleChange}
                                    value={values.requirement}
                                />
                            </div>




                        </div>





                    </div >
                    <div className='text-center'>
                        <button className="btn btn-success w-50"
                            type='submit'>Submit</button>
                    </div>
                </form>
                )}


            </Formik>







        </div >
    )
}

export default CompetitionEntry
